import React from 'react';
import './App.css'; // You can create this CSS file for styling

function App() {
  return (
    <div className="App">
      <header>
        <h1>Elite Sports Dog Rating</h1>
        {/* Navigation Links */}
        <nav>
          <ul>
            <li><a href="#">Home</a></li>
            <li><a href="#">Dogs</a></li>
            <li><a href="#">About</a></li>
            {/* Add more links as needed */}
          </ul>
        </nav>
      </header>
      <main>
        {/* Main Content Area */}
        <section>
          <h2>Find Your Perfect Dog</h2>
          {/* Add search filters here */}
        </section>
      </main>
      <footer>
        <p>&copy; 2024 Elite Sports</p>
        {/* Add additional footer content as needed */}
      </footer>
    </div>
  );
}

export default App;
